  &lt;div id="cf-wrapper"&gt;
    &lt;div class="cf-alert cf-alert-error cf-cookie-error" id="cookie-alert" data-translate="enable_cookies"&gt;Please enable cookies.&lt;/div&gt;
    &lt;div id="cf-error-details" class="cf-error-details-wrapper"&gt;
      &lt;div class="cf-wrapper cf-header cf-error-overview"&gt;
        &lt;h1 data-translate="challenge_headline"&gt;One more step&lt;/h1&gt;
        &lt;h2 class="cf-subheadline"&gt;&lt;span data-translate="complete_sec_check"&gt;Please complete the security check to access&lt;/span&gt; khilafa.org&lt;/h2&gt;
      &lt;/div&gt;&lt;!-- /.header --&gt;

      &lt;div class="cf-section cf-highlight cf-captcha-container"&gt;
        &lt;div class="cf-wrapper"&gt;
          &lt;div class="cf-columns two"&gt;
            &lt;div class="cf-column"&gt;
              &lt;div class="cf-highlight-inverse cf-form-stacked"&gt;
                &lt;form class="challenge-form" id="challenge-form" action="/cdn-cgi/l/chk_captcha" method="get"&gt;
  &lt;script type="text/javascript" src="/cdn-cgi/scripts/cf.challenge.js" data-type="normal"  data-ray="30fb78bd545f4e96" async data-sitekey="6LfOYgoTAAAAAInWDVTLSc8Yibqp-c9DaLimzNGM" data-stoken="fl5gc_M14MlvBWkagabZ2331buzai7si3RQwWaoZ2VW5hSm4wEZ8L1YKpEo4Y0i1pIz1ritxlzKjMC1447g_j_I0fPASTkKG6EZ0E_o-7GA"&gt;&lt;/script&gt;
  &lt;div class="g-recaptcha"&gt;&lt;/div&gt;
